import React from 'react';
import avatar from '../../assets/satwinder.png';
function Certificate() {
  return (
    <section className="m-5 p-5 bg-dark">
    <h2 className='m-5'>
      Certifications
    </h2>
    <h3 className='m-5'>
      Aws Certifications
    </h3> 
    <div className='d-flex'>
      <img src="../../assets/images/certifications/aws1.png"></img>
    </div>
  </section>
  );
}

export default Certificate;
